import React from 'react';
import '../styles/Home.css';
import pokemonLogo from '../assets/logos/pokemon.png';

const Home = () => {
  return (
    <div className="home">
      <div>
        <img src={pokemonLogo} alt="Pokédex Logo" className="home-logo" />
        <p>Explora el mundo de los Pokémon y descubre sus características.</p>
      </div>
    </div>
  );
};

export default Home;
